@import url(../css/font.css);
@import url(../css/reset.css);
@import url(../css/default.css);

img {
    display: block;
    overflow: hidden;
    width: 100%;
    object-fit: cover;
}

.body_wrap {
    display: grid;
    width: 100%;
    grid-template-columns: 1fr;
    border-left:  0.1rem solid #adadad;
    border-right:  0.1rem solid #adadad;
    position: relative;
}



.open_btn_wrap,
.close_btn_wrap {
    display: none;
}

.aside_wrap {
    position: fixed;
    width: 40rem;

}
.content_wrap {
    margin-left: 40rem;
    border-left:  0.1rem solid #adadad;
}

.aside_wrap aside {
    left: 0;
    top: 0;
    width: 100%;
    height: 100vh;
}


aside .gnb {
    margin: 3rem 0 0 5.5rem;
}

aside .gnb ul li a {
    font-size: 4rem;
    font-weight: 600;
    line-height: 7rem;
}

aside .logo {
    position: absolute;
    left: 0;
    bottom: 0;
}

aside .logo a {
    display: block;
    font-size: 0;
    line-height: 0;
    width: 40rem;
    height: 14rem;
    background-image: url(../images/logo.png);
    background-repeat: no-repeat;
    background-size: 40rem auto;
}

.exhibition .Exhibit_info a img,
.education .edu_info a img {
    display: block;
    max-width: 100%;
}

.exhibition .Exhibit_tit {
    margin: 3rem 4.5rem 0 0;
    text-align: right;
    font-weight: 600;
    font-size: 4rem;
}

.exhibition {
    display: grid;
    grid-template-columns: 1fr 2fr;
    overflow-x: auto;
}

.exhibition .Exhibit_info {
    border-left:  0.1rem solid #adadad;
}

.exhibition .Exhibit_info ul {
    display: flex;
    justify-content: space-between;
    align-items: flex-end;
    font-size: 2rem;
    padding: 2rem
}

.exhibition .Exhibit_info .tit .title_ko {
    font-size: 2.6rem;
}


.education {
    display: grid;
    grid-template-columns: 1fr 2fr;
    border-top:  0.1rem solid #adadad;
    overflow-x: auto;

}

.education .edu_tit {
    display: grid;
    grid-template-rows: 4fr 1fr;
    margin: 2rem 3.5rem 0 0;
    text-align: right;
    font-weight: 600;
    font-size: 4rem;
}


.education .edu_tit a {
    display: block;
    font-size: 2.2rem;
    font-weight: 400;
    text-decoration: underline;
}

.education .edu_info {
    display: grid;
    grid-template-columns: 1fr 1fr;
    overflow-x: auto;
    width: 100%;
    border-left:  0.1rem solid #adadad;
    ;
}

.education .edu_info .edu_subtit {
    display: block;
    font-size: 2.2rem;
    line-height: 5rem;
    padding-left: 1rem;
    color: #fbfbfb;
    background-color: #2b2b2b;
}

.tottv {
    display: grid;
    grid-template-columns: 3fr 2fr;
    height: max-content;
    border-top:  0.1rem solid #adadad;
}
.tottv .tottv_tit {
    display: grid;
    grid-template-rows: 5fr 1fr;}
.tottv .tottv_tit img {
    width: 30%;
    margin: 4rem 0 0 4rem
}

.tottv .tottv_tit a {
    display: block;
    margin: 0 3rem 0 0;
text-align: right;
    font-size: 2.2rem;
    font-weight: 400;
    text-decoration: underline;
}

.tottv .tottv_video {
    border-left:  0.1rem solid #adadad;
}

.tottv .tottv_video .youtube_wrap {
    display: block;
    position: relative;
    width: 100%;
    height: 30rem;
}

.tottv .tottv_video .youtube_wrap iframe {
    position: absolute;
    top: 0;
    right: 0;
    width: 100%;
    height: 100%;
}


.tottv .tottv_video em {
    font-size: 3rem;
    font-weight: 600;
    line-height: 6rem;
    margin-left: 2rem;
}

.press {
    display: grid;
    grid-template-columns: 1fr 7fr 2fr;
    border-top:  0.1rem solid #adadad;

}

.press .press_info {
    grid-column: 2;
    background-color: #2b2b2b;
}

.press .press_info .press_logo {
    margin: 3rem 0 6.5rem 2rem;
    width: 60%;
    object-fit: contain;
}

.press .press_info .view {
    display: block;
    font-size: 2.2rem;
    font-weight: 400;
    margin-right: 2rem;
    margin-bottom: 2rem;
    text-decoration: underline;
    color: #fbfbfb;
    text-align: right;
}

.press .press_info .book_pic {
