    margin-right: 1rem;
}

.press .former_totaldesign {
    position: relative;
}

.press .former_totaldesign .dream {
    font-size: 0;
    line-height: 0;

}

.press .former_totaldesign .dream::before {
    width: 8.5rem;
    height: 8.5rem;
    position: absolute;
    top: 3rem;
    right: 2rem;
    background-image: url(../images/DREAMM.png);
    background-repeat: no-repeat;
    background-size: 8rem auto;
    content: '';
}

.press .former_totaldesign .formerlogo {
    font-size: 0;
    line-height: 0;

}

.press .former_totaldesign .formerlogo::before {
    position: absolute;
    bottom: 2rem;
    right: 2rem;
    width: 3rem;
